sys_variable_value.value:
(function execute(inputs, outputs) {
    var obs = new OracleBlockStorageUtils();
    obs.validateInputVariables(inputs, outputs);
    obs.validateMandatoryVariables(inputs, ["availability_domain", "compartment_id", "display_name", "source_details"]);
    var requestBody = {
        "availabilityDomain": inputs.availability_domain,
        "compartmentId": inputs.compartment_id,
        "displayName": inputs.display_name,
        "sourceDetails": {}
    };
    var source = inputs.source_details;
    if (source.type.trim())
        requestBody.sourceDetails.type = source.type;

    if (source.volumeIds.length > 0) {
        var volumeids = [];
        source.volumeIds.forEach(function(volumeId) {
            if (volumeId.trim())
                volumeids.push(volumeId.toLowerCase());
        });
        if (volumeids.length > 0)
            requestBody.sourceDetails.volumeIds = volumeids;
    }
    obs.trimValues(inputs.freeformtags);
    var tags = obs.createTagsPayload(inputs.freeformtags);
    if (Object.keys(tags).length) {
        requestBody.freeformTags = tags;
    }

    outputs.payload = JSON.stringify(requestBody);
})(inputs, outputs);

